import{_ as e,c as t}from"./app.005b98c8.js";const i={},a=t('<h1 id="\u63D0\u4F9B\u65B0\u67AB\u4E4B\u8C37-tms\u53F0\u670D\u5192\u9669\u5C9B-\u5B89\u5168\u53EF\u9760\u7684\u4EE3\u7EC3\u670D\u52A1" tabindex="-1"><a class="header-anchor" href="#\u63D0\u4F9B\u65B0\u67AB\u4E4B\u8C37-tms\u53F0\u670D\u5192\u9669\u5C9B-\u5B89\u5168\u53EF\u9760\u7684\u4EE3\u7EC3\u670D\u52A1" aria-hidden="true">#</a> \u63D0\u4F9B\u65B0\u67AB\u4E4B\u8C37\uFF08TMS\u53F0\u670D\u5192\u9669\u5C9B\uFF09\u5B89\u5168\u53EF\u9760\u7684\u4EE3\u7EC3\u670D\u52A1</h1><div class="custom-container danger"><p class="custom-container-title">\u5B89\u5168\u8B66\u544A</p><p>\u8D8A\u6765\u8D8A\u591A\u7684\u4EE3\u7EC3\u5DF2\u7ECF\u5728\u6D17\u53F7\u4E86\uFF0C\u8FD9\u662F\u4EF6\u975E\u5E38\u4EE4\u4EBA\u4F24\u5FC3\u7684\u4E8B\uFF01</p><p>\u4E3A\u4E86\u60A8\u7684\u8D26\u53F7\u8D22\u4EA7\u5B89\u5168\uFF0C\u5EFA\u8BAE\u60A8\uFF1A</p><ul><li>\u9009\u62E9\u53EF\u9760\u7684\u4EE3\u7EC3\uFF0C\u6700\u597D\u80FD\u5168\u7A0B\u76F4\u64AD\u7684\u3002</li><li>\u4E0D\u900F\u9732\u4E8C\u7EA7\u5BC6\u7801\uFF0C\u8D35\u91CD\u7269\u54C1\u5B58\u653E\u4ED3\u5E93\uFF0C\u968F\u8EAB\u88C5\u5907\u8BF7\u4E0A\u9501\u3002</li><li>\u4E3A\u9632\u6B62\u88AB\u793E\u5DE5\uFF0C\u4EE3\u7EC3\u524D\u4FEE\u6539\u4E00\u4E2A\u7B80\u5355\u5BC6\u7801\uFF0C\u4EE3\u7EC3\u5B8C\u6539\u56DE\u539F\u5BC6\u7801\u6216\u65B0\u7684\u590D\u6742\u5BC6\u7801\u3002</li><li>\u5DF2\u7ECF\u597D\u51E0\u4E2A\u65B0\u4EBA\u627E\u6DD8\u5B9D\u7684\u4EE3\u7EC3\uFF0C\u59D4\u6258\u6211\u53BB\u67E5\u770B\u8FDB\u5EA6\u65F6\uFF0C\u5DF2\u7ECF\u786E\u8BA4\u662F\u5916\u6302\u4EE3\u7EC3\u3002\u4E8B\u540E\u8FD8\u6709\u4E00\u4E2A\u5C0F\u4F19\u4F34\u901A\u8FC7\u5927\u4E8B\u4EF6\u67E5\u770B\u5230\u88AB\u5C1D\u8BD5\u6301\u7EED\u4E00\u4E2A\u591A\u5C0F\u65F6\u7684\u767B\u5F55\u64CD\u4F5C\u3002\u8BF7\u8FDC\u79BB\u6DD8\u5B9D\u7684\u4E0D\u53EF\u9760\u4EE3\u7EC3\u3002</li></ul></div><blockquote><p>\u7531\u4E8E <code>\u5C0FT\u540C\u5B66</code> \u591A\u6570\u5904\u4E8E\u5FD9\u788C\u72B6\u6001\uFF0C\u4EE3\u7EC3\u65B9\u9762\u4E3B\u8981\u770B\u5C0F\u4F19\u4F34\u7684\u65F6\u95F4\u5B89\u6392\uFF0C\u5982\u679C\u5C0F\u4F19\u4F34\u4EEC\u624B\u4E0A\u5FD9\u7740\uFF0C\u6211\u4EEC\u4F1A\u62D2\u7EDD\u60A8\u7684\u4EE3\u7EC3\u9700\u6C42\uFF0C\u8BF7\u4F53\u8C05\uFF01</p></blockquote><h2 id="\u5199\u5728\u524D\u8A00" tabindex="-1"><a class="header-anchor" href="#\u5199\u5728\u524D\u8A00" aria-hidden="true">#</a> \u5199\u5728\u524D\u8A00</h2><p>\u5982\u679C\u60A8\u4E0D\u5C0F\u5FC3\u8FDB\u6765 <code>\u5C0FT\u540C\u5B66</code> \u8FD9\u4E2A\u7F51\u7AD9\uFF0C\u7136\u540E\u53C8\u5F88\u4E0D\u5C0F\u5FC3\u5730\u8FDB\u5230\u8FD9\u4E2A\u9875\u9762\uFF0C\u60F3\u5FC5\u60A8\u60F3\u5BFB\u627E\u4EE3\u7EC3\uFF0C\u6216\u8005\u4E86\u89E3\u4EE3\u7EC3\u670D\u52A1\u3002</p><p>\u5982\u679C\u60A8\u5E76\u4E0D\u662F\u60F3\u4E86\u89E3\u4EE3\u7EC3\u6216\u8005\u5BFB\u627E\u4EE3\u7EC3\uFF0C\u90A3\u4E48\uFF0C\u6211\u5E94\u8BE5\u53CD\u601D\u81EA\u5DF1\uFF0C\u4E3A\u4EC0\u4E48\u8BA9\u60A8\u8FD9\u4E48\u5BB9\u6613\u770B\u5230\u4E86\u8FD9\u4E2A\u9875\u9762\uFF0C\u56E0\u4E3A\u672C\u7AD9\u6838\u5FC3\u662F\u4E00\u4E2A\u5145\u6EE1\u4E86\u65B0\u67AB\u4E4B\u8C37\u63A2\u7D22\u6210\u679C\u7684\u7F51\u7AD9\uFF0C\u5E76\u4E0D\u60F3\u76F4\u63A5\u5C55\u793A\u6709\u507F\u7684\u4EE3\u7EC3\u670D\u52A1\uFF0C\u8FD9\u5E76\u4E0D\u662F\u65B0\u67AB\u4E4B\u8C37\u7684\u63A2\u7D22\u6210\u679C\u3002</p><h2 id="\u524D\u8A00" tabindex="-1"><a class="header-anchor" href="#\u524D\u8A00" aria-hidden="true">#</a> \u524D\u8A00</h2><p>\u672C\u7AD9\u8FD9\u4E48\u591A\u5E74\u6765\u4E00\u76F4\u90FD\u5B58\u5728\u7740\u8FD9\u4E2A\u4EE3\u7EC3\u9875\u9762\uFF0C\u8FD9\u6B21\u6539\u7248\u51E0\u6B21\u90FD\u5728\u51B3\u5B9A\u8981\u4E0D\u8981\u53BB\u6389\u4EE3\u7EC3\u8FD9\u4E2A\u9875\u9762\uFF0C\u5B9E\u5728\u662F\u56E0\u4E3A\u6211\u592A\u5FD9\u4E86\uFF0C\u800C\u4E14\u5C0F\u4F19\u4F34\u4EEC\u4E5F\u4E00\u76F4\u5728\u7EC3\u7740<code>\u661F\u4E91</code>\u7684\u53F7\u3002</p><p>\u6700\u4E3B\u8981\u7684\uFF1A\u8FD9\u4E48\u591A\u5E74\u6765\u6CA1\u6709\u4E00\u4E2A\u8001\u677F\u662F\u901A\u8FC7\u8FD9\u4E2A\u9875\u9762\u6765\u627E\u6211\u4EEC\u4EE3\u7EC3\u7684\uFF0C\u5B9E\u5728\u662F\u60E8\u54C7\uFF01</p><p>\u7761\u89C9\u4E4B\u524D\uFF0C\u51E0\u6B21\u90FD\u60F3\u8D77\u6765\u628A\u8FD9\u4E2A\u9875\u9762\u5220\u6389\uFF01</p><p>\u7136\u800C\uFF0C\u5374\u6709\u8D8A\u6765\u8D8A\u591A\u7684\u4EBA\u88AB\u4EE3\u7EC3\u6D17\u53F7\u4E86\uFF01</p><p>\u{1F494}</p><p>\u867D\u7136\u6211\u5F88\u5FD9\uFF0C\u5C0F\u4F19\u4F34\u4EEC\u4E5F\u8BB8\u4E5F\u96BE\u4EE5\u5168\u804C\u4EE3\u7EC3\uFF0C\u4F46\u662F\u6211\u60F3\u8BA9\u5B89\u5168\u53EF\u9760\u7684\u4EE3\u7EC3\u6301\u7EED\u53D1\u5C55\u4E0B\u53BB\uFF0C\u5E76\u4E0D\u662F\u8BF4\u8981\u627E\u6211\u4EEC\uFF0C\u800C\u662F\u6B63\u5982\u5F00\u7BC7\u7684<code>\u5B89\u5168\u8B66\u544A</code>\u6240\u5199\u7684\u90A3\u6837\uFF0C\u90A3\u6015\u662F\u518D\u53EF\u9760\uFF0C\u4EBA\u5FC3\u4E0D\u53E4\uFF0C\u8BF7\u591A\u591A\u9632\u8303\uFF01\uFF01\uFF01</p><p>\u5982\u679C\u60A8\u6709\u8FD9\u65B9\u9762\u7684\u9700\u6C42\uFF0C\u4E0D\u59A8\u53EF\u4EE5\u53BB\u76F4\u64AD\u5E73\u53F0\u627E\u627E\u90A3\u4E9B\u4E3B\u64AD\uFF0C\u4F46\u662F\u8981\u6CE8\u610F\u505A\u597D\u5B89\u5168\u4FDD\u969C\u5DE5\u4F5C\u3002</p><div class="custom-container danger"><p class="custom-container-title">\u8457\u540D\u4E3B\u64AD\u5927\u9762\u79EF\u6D17\u53F7\u4E8B\u4EF6</p><p>\u597D\u5947\u4E3B\u64AD\u901A\u8FC7\u591A\u5E74\u4EE3\u7EC3\uFF0C\u62E5\u6709\u7740\u96BE\u4EE5\u60F3\u50CF\u7684\u8D26\u53F7\u8BB0\u5F55\uFF0C\u5DF2\u77E5\u4ECE 2021 \u5E74 9 \u6708\u5F00\u59CB\u5077\u5077\u6D17\u53F7\uFF0C\u76F4\u5230 2021 \u5E74 12 \u6708 \u88AB\u53D1\u73B0\uFF0C\u671F\u95F4\u76D7\u6D17\u7684\u4EF7\u503C\u5DF2\u7ECF\u8D85\u8FC7\u51E0\u5341\u4E07\u4EBA\u6C11\u5E01\uFF0C\u6216\u8BB8\u9AD8\u8FBE\u767E\u4E07\u4EBA\u6C11\u5E01\uFF08\u672A\u8003\u5BDF\u8BC1\u5B9E\uFF0C\u53EA\u662F\u731C\u6D4B\uFF09</p></div><h2 id="\u627F\u63A5\u7684\u4E1A\u52A1" tabindex="-1"><a class="header-anchor" href="#\u627F\u63A5\u7684\u4E1A\u52A1" aria-hidden="true">#</a> \u627F\u63A5\u7684\u4E1A\u52A1</h2><blockquote><p>\u7531\u4E8E<code>\u5C0FT\u540C\u5B66</code>\u5FD9\u4E8E\u5DE5\u4F5C\uFF0C\u56DE\u590D\u53EF\u80FD\u5E76\u4E0D\u53CA\u65F6\uFF0C\u4EE3\u7EC3\u65B9\u9762\u4E3B\u8981\u770B\u5C0F\u4F19\u4F34\u7684\u65F6\u95F4\u5B89\u6392\uFF0C\u5982\u679C\u5C0F\u4F19\u4F34\u4EEC\u624B\u4E0A\u5FD9\u7740\uFF0C\u6211\u4EEC\u4F1A\u62D2\u7EDD\u60A8\u7684\u4EE3\u7EC3\u9700\u6C42\uFF0C\u8BF7\u4F53\u8C05\uFF01</p></blockquote><p>\u4E4B\u524D\u8FD8\u627F\u63A5\u4E00\u4E9B\u76F8\u5173\u6D3B\u52A8\u53CA BOSS \u4EFB\u52A1\u7B49\uFF0C\u73B0\u5728\u6211\u4EEC\u53EA\u63A5\u7B49\u7EA7\u4E1A\u52A1\uFF0C\u4E3B\u8981\u6536\u8D39\u4E3A\uFF1A</p><ul><li>10-140 \u7B49\u7EA7\u6536\u8D39\u4E3A\uFF1A<strong>40</strong> \u5143/\u4E2A</li><li>10-200 \u7B49\u7EA7\u6536\u8D39\u4E3A\uFF1A<strong>150</strong> \u5143/\u4E2A</li><li>140-200 \u7B49\u7EA7\u6536\u8D39\u4E3A\uFF1A<strong>100</strong> \u5143/\u4E2A</li><li>\u71C3\u70E7 10-200 \u7B49\u7EA7\u6536\u8D39\u4E3A\uFF1A<strong>50</strong> \u5143/\u4E2A</li><li>\u5927\u53F7 200+ \u7B49\u7EA7\u6309\u5C0F\u65F6\u6536\u8D39\uFF1A<strong>35</strong> \u5143/\u5C0F\u65F6</li></ul><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>\u8BF7\u81EA\u884C\u51C6\u5907\u4E00\u4E9B\u70B9\u6570\uFF0C\u4EE5\u786E\u4FDD\u7EC3\u53F7\u65F6\u6709\u5546\u57CE\u52A0\u500D\u5361\uFF0C\u4EE5\u53CA\u5BA0\u7269\u4E00\u4E2A\uFF08\u540C\u804C\u4E1A\u7FA4\u53EA\u9700\u8981\u6709\u4E00\u4E2A\u5BA0\u7269\u5C31\u53EF\u4EE5\u4E86\uFF09</p><p>\u5927\u53F7 200+ \u51B2\u7B49\u7EA7\uFF0C\u4E3A\u4FDD\u6548\u7387\uFF0C\u79D2\u602A\u662F\u57FA\u7840\u3002</p></div><h3 id="\u{1F535}-\u5957\u9910\u4E00-\u4E3B\u53F7-12-\u4E2A-link-\u53F7" tabindex="-1"><a class="header-anchor" href="#\u{1F535}-\u5957\u9910\u4E00-\u4E3B\u53F7-12-\u4E2A-link-\u53F7" aria-hidden="true">#</a> \u{1F535} \u5957\u9910\u4E00\uFF1A\u4E3B\u53F7 + 12 \u4E2A Link \u53F7</h3><p>\u60A8\u53EF\u4EE5\u6307\u5B9A\u4E00\u4E2A\u804C\u4E1A\u4E3A\u4E3B\u53F7\u89D2\u8272\uFF0C\u6211\u4EEC\u4F1A\u4E3A\u8FD9\u4E2A\u89D2\u8272\u7EC3\u5230 200 \u7B49\u7EA7\uFF0C\u4EE5\u65B9\u4FBF\u60A8\u53EF\u4EE5\u6B63\u5F0F\u5F00\u59CB\u795E\u79D8\u6CB3\u4E4B\u65C5\u3002</p><p>\u540C\u65F6\uFF0C\u60A8\u518D\u5B89\u6392 12 \u4E2A Link \u7684\u804C\u4E1A\uFF08\u5982\u679C\u4E0D\u77E5\u9053\u4F55\u4E3A Link \uFF0C\u53EF\u4EE5\u67E5\u9605\u672C\u7AD9\u7684 Link \u4F20\u6388\u53CA\u8054\u76DF\u6218\u529B\u6587\u7AE0\uFF09</p><ul><li>\u672C\u5C0A\u5927\u53F7 10-200 \u7B49\u7EA7\u6536\u8D39\uFF1A150 \u5143/\u4E2A</li><li>12 \u4E2A Link 10-140 \u7B49\u7EA7\u6536\u8D39\uFF1A40 \u5143/\u4E2A x 12 = 480 \u5143/\u5408\u8BA1</li><li>\u8D39\u7528\u4E3A\uFF1A<s>630 \u5143</s></li></ul><p>\u5957\u9910\u4F18\u60E0\u4EF7\u4E3A\uFF1A<strong>580</strong> \u5143\uFF08\u7701 50\uFF09\uFF0C\u5927\u7EA6\u7528\u65F6 7 \u5929\u3002</p><blockquote><p>\u5982\u679C\u60A8\u5DF2\u7ECF\u62E5\u6709\u4E00\u4E2A 200+ \u7684\u5927\u53F7\uFF0C\u6216\u8005\u5F53\u65F6\u6709 10-200 \u7684\u71C3\u70E7\u6D3B\u52A8\uFF0C\u90A3\u4E48\u5957\u9910\u4F18\u60E0\u4EF7\u4E3A\u6240\u6709\u603B\u548C\u518D\u51CF\u5C11\u76F8\u5BF9\u5E94\u7684\u4EF7\u683C</p></blockquote><h3 id="\u{1F7E3}-\u5957\u9910\u4E8C-6000-\u8054\u76DF" tabindex="-1"><a class="header-anchor" href="#\u{1F7E3}-\u5957\u9910\u4E8C-6000-\u8054\u76DF" aria-hidden="true">#</a> \u{1F7E3} \u5957\u9910\u4E8C\uFF1A6000 \u8054\u76DF</h3><p>6000 \u8054\u76DF\u4F1A\u7ED9\u6574\u4F53\u5E26\u6765\u975E\u5E38\u53EF\u89C2\u7684\u5C5E\u6027\u52A0\u6210\uFF0C\u6211\u4EEC\u7684 6000 \u8054\u76DF\u5957\u9910\u53EF\u80FD\u4F1A\u548C\u522B\u4EBA\u7684\u4E0D\u4E00\u6837\uFF0C\u4E3B\u8981\u662F\u6211\u4EEC\u7AD9\u5728\u60A8\u7684\u89D2\u5EA6\u601D\u8003\u8861\u91CF\uFF0C\u91C7\u7528\u7684\u662F\uFF1A5 \u4E2A 200 \u7B49\u7EA7\u7684\u53F7\uFF08\u5305\u62EC\u4E3B\u53F7\u5728\u5185\uFF09\uFF0C\u52A0\u4E0A 35 \u4E2A 140 \u7B49\u7EA7\u7684\u53F7\u7EC4\u6210\u3002</p><p>\u5148\u522B\u7D27\u5F20\uFF0C\u6211\u4EEC\u5E76\u6CA1\u6709\u6545\u610F\u63A8\u8350\u591A\u7EC3\u66F4\u9AD8\u7B49\u7EA7\u7684\u53F7\u6765\u591A\u8D5A\u60A8\u7684\u94B1\u3002</p><p>\u4E14\u542C\u5206\u6790\u5206\u6790\uFF1A</p><p>\u4F17\u6240\u5468\u77E5 200 \u7B49\u7EA7\u7684\u8054\u76DF\u7B49\u7EA7\u4E3A SS \u7EA7\uFF0C\u800C 140 \u7B49\u7EA7\u7684 \u8054\u76DF\u7B49\u7EA7\u4E3A S \u7EA7\uFF0C\u4ED6\u4EEC\u4E4B\u95F4\u7684\u5C5E\u6027\u52A0\u6210\u662F\u4E0D\u4E00\u6837\u7684\uFF0C\u60A8\u53EF\u4EE5\u9009\u62E9\u4E94\u4E2A\u5F3A\u529B\u7684\u8054\u76DF\u52A0\u6210\u804C\u4E1A\u6307\u5B9A\u5230 200 \u7B49\u7EA7\u3002</p><p>\u8FD9\u6837\u540C\u522B\u4EBA\u53EA\u6709\u4E00\u4E2A 200 \u7B49\u7EA7\u7EC4\u5408\u7684 6000 \u8054\u76DF\uFF0C\u6218\u6597\u529B\u52A0\u6210\u4E0A\u662F\u66F4\u591A\u66F4\u5F3A\u7684\u3002</p><p>\u6211\u4EEC\u5148\u7B97\u7B97\u8FD9\u6837\u603B\u8054\u76DF\u6218\u529B\uFF1A</p><ul><li>5 \u4E2A 200 \u7B49\u7EA7 = 1000</li><li>35 \u4E2A 140 \u7B49\u7EA7 = 4900</li><li>\u603B\u6218\u529B\u4E3A\uFF1A5900</li></ul><p>\u522B\u6025\uFF0C\u6211\u4EEC\u514D\u8D39\u8D60\u9001 100 \u8054\u76DF\u6218\u529B\u7B49\u7EA7\uFF01</p><p>\u6211\u4EEC\u4F1A\u5728 35 \u4E2A 140 \u7B49\u7EA7\u7684\u89D2\u8272\u91CC\uFF0C\u6BCF\u4E2A\u89D2\u8272\u591A\u7EC3 2-3 \u7EA7\uFF0C\u4EE5\u8865\u5168\u8FD9 100 \u8054\u76DF\u6218\u6597\u529B\uFF01</p><p>\u6CA1\u9519\uFF0C\u7B49\u4E8E\u9001 100 \u7B49\u7EA7\uFF01</p><p>\u8BF4\u518D\u591A\uFF0C\u4E0D\u5982\u518D\u770B\u770B\u4EF7\u683C\uFF1A</p><ul><li>5 \u4E2A 200 \u7B49\u7EA7 = 150 x 5 = 750 \u5143</li><li>35 \u4E2A 140 \u7B49\u7EA7 = 40 x 35 = 1400 \u5143</li><li>\u8D39\u7528\u4E3A\uFF1A<s>2150 \u5143</s></li></ul><p>\u5957\u9910\u4F18\u60E0\u4EF7\u4E3A\uFF1A<strong>2000</strong> \u5143\uFF08\u7701 150\uFF0C\u8FD8\u9001 100 \u7B49\u7EA7\uFF09\uFF0C\u5927\u7EA6\u7528\u65F6 20-25 \u5929\u3002</p><blockquote><p>\u5982\u679C\u60A8\u5DF2\u7ECF\u62E5\u6709\u4E00\u4E2A 200+ \u7684\u5927\u53F7\uFF0C\u6216\u8005\u5F53\u65F6\u6709 10-200 \u7684\u71C3\u70E7\u6D3B\u52A8\uFF0C\u90A3\u4E48\u5957\u9910\u4F18\u60E0\u4EF7\u4E3A\u6240\u6709\u603B\u548C\u518D\u51CF\u5C11\u76F8\u5BF9\u5E94\u7684\u4EF7\u683C</p></blockquote><h3 id="\u{1F7E4}-\u5957\u9910\u4E09-8000-\u8054\u76DF" tabindex="-1"><a class="header-anchor" href="#\u{1F7E4}-\u5957\u9910\u4E09-8000-\u8054\u76DF" aria-hidden="true">#</a> \u{1F7E4} \u5957\u9910\u4E09\uFF1A8000 \u8054\u76DF</h3><p>8000 \u8054\u76DF\u5C31\u7B80\u5355\u4E9B\u4E86\uFF0C\u76F4\u63A5 40 \u4E2A 200 \u7B49\u7EA7\u7684\u804C\u4E1A\u5C31\u641E\u5B9A\u3002</p><ul><li>40 \u4E2A 200 \u7B49\u7EA7 = 40 x 150 = <s>6000 \u5143</s></li></ul><p>\u5957\u9910\u4F18\u60E0\u4EF7\u4E3A\uFF1A<strong>5000</strong> \u5143\uFF08\u7701 1000\uFF09\uFF0C\u5927\u7EA6\u7528\u65F6 30-40 \u5929\u3002</p><h2 id="\u5173\u4E8E\u4EF7\u683C\u548C\u65F6\u957F" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u4EF7\u683C\u548C\u65F6\u957F" aria-hidden="true">#</a> \u5173\u4E8E\u4EF7\u683C\u548C\u65F6\u957F</h2><p>\u4EE3\u7EC3\u7684\u4EF7\u683C\u662F\u4E0D\u5305\u542B\u53CC\u500D\u52A0\u500D\u5361\u90A3\u4E9B\u7684\uFF0C\u6240\u4EE5\uFF0C\u60A8\u7684\u53F7\u4E0A\u5E94\u8BE5\u51C6\u5907\u4E00\u4E9B\u70B9\u6570\u3002</p><p>\u4EF7\u683C\u4E4B\u6240\u4EE5\u5982\u6B64\u4F18\u60E0\uFF0C\u5B9E\u5728\u662F\u56E0\u4E3A\u6211\u4EEC\u4E0D\u662F\u5168\u804C\u4EE3\u7EC3\uFF0C\u6548\u7387\u4E0A\u5C31\u6CA1\u90A3\u4E48\u9AD8\u6548\uFF0C\u6BD5\u7ADF\u624B\u52A8\u4EE3\u7EC3\u3002</p><p>\u6240\u4EE5\u65F6\u957F\u65B9\u9762\uFF0C\u4E5F\u5C31\u6298\u7B97\u5E73\u5747\u4E00\u5929\u4E00\u4E2A 200 \u7EA7\u7684\u53F7 \u6216\u8005 2 \u4E2A 140 \u7EA7\u7684\u53F7\u3002</p><p>\u5982\u679C\u60A8\u8FFD\u6C42\u9AD8\u65F6\u6548\uFF0C\u6216\u8BB8\uFF0C\u60A8\u627E\u627E\u5176\u4ED6\u4EE3\u7EC3\u4F1A\u66F4\u4E3A\u5408\u9002\u3002</p><h2 id="\u8054\u7CFB\u65B9\u5F0F" tabindex="-1"><a class="header-anchor" href="#\u8054\u7CFB\u65B9\u5F0F" aria-hidden="true">#</a> \u8054\u7CFB\u65B9\u5F0F</h2><table><thead><tr><th style="text-align:left;">\u6E20\u9053</th><th style="text-align:left;">\u65B9\u5F0F</th><th style="text-align:left;">\u7528\u9014</th></tr></thead><tbody><tr><td style="text-align:left;">QQ</td><td style="text-align:left;">QQ\uFF1A87182380<a href="https://wpa.qq.com/msgrd?v=3&amp;uin=87182380&amp;site=qq&amp;menu=yes" target="_blank" rel="noopener noreferrer">\u70B9\u6211QQ\u8054\u7CFB</a></td><td style="text-align:left;">\u901A\u8FC7 QQ \u53CA\u65F6\u5728\u7EBF\u6C9F\u901A\u3002\u6CE8\uFF1A\u7531\u4E8E\u591A\u6570\u5904\u4E8E\u5DE5\u4F5C\u72B6\u6001\uFF0C\u56DE\u590D\u53EF\u80FD\u5E76\u4E0D\u53CA\u65F6</td></tr></tbody></table><h2 id="\u6CA1\u6709\u4EBA\u6BD4\u60A8\u81EA\u5DF1\u66F4\u6CE8\u91CD\u5B89\u5168-\u4E5F\u6CA1\u6709\u4EBA\u6BD4\u6211\u4EEC\u66F4\u6CE8\u91CD\u53E3\u7891" tabindex="-1"><a class="header-anchor" href="#\u6CA1\u6709\u4EBA\u6BD4\u60A8\u81EA\u5DF1\u66F4\u6CE8\u91CD\u5B89\u5168-\u4E5F\u6CA1\u6709\u4EBA\u6BD4\u6211\u4EEC\u66F4\u6CE8\u91CD\u53E3\u7891" aria-hidden="true">#</a> \u6CA1\u6709\u4EBA\u6BD4\u60A8\u81EA\u5DF1\u66F4\u6CE8\u91CD\u5B89\u5168\uFF0C\u4E5F\u6CA1\u6709\u4EBA\u6BD4\u6211\u4EEC\u66F4\u6CE8\u91CD\u53E3\u7891</h2><p>\u5DF2\u7ECF\u53D1\u751F\u592A\u591A\u4EE3\u7EC3\u5728\u6D17\u53F7\u4E86\uFF0C\u4E3A\u4E86\u4FDD\u969C\u60A8\u7684\u8D22\u4EA7\u5B89\u5168\uFF0C<code>\u5C0FT\u540C\u5B66</code>\u5E76\u6CA1\u6709\u589E\u52A0\u5C0F\u4F19\u4F34\u6765\u4EE3\u7EC3\uFF0C\u76EE\u524D\u6211\u4EEC\u4EC5\u6709\u4E09\u4EBA\uFF1A</p><ul><li><code>\u5C0FT\u540C\u5B66</code></li><li><code>Diunashen</code></li><li><code>\u6C5F\u6728\u5DDD\u67EF\u5357</code></li></ul><p>\u6211\u4EEC\u6DF1\u77E5\uFF0C\u6CA1\u6709\u4EBA\u80FD\u6BD4\u60A8\u66F4\u6CE8\u91CD\u8D26\u53F7\u7684\u5B89\u5168\uFF0C\u540C\u6837\u4E5F\u6DF1\u77E5\uFF0C\u6CA1\u6709\u4EBA\u6BD4\u6211\u4EEC\u66F4\u6CE8\u91CD\u53E3\u7891\u3002</p><p>\u8BDA\u4FE1\uFF0C\u662F\u6211\u4EEC\u7684\u6839\u672C\u3002</p><p>\u90A3\u6015\u662F\u6700\u7EC8\u6CA1\u80FD\u4E3A\u60A8\u63D0\u4F9B\u4EE3\u7EC3\u670D\u52A1\uFF0C\u6211\u4EEC\u4E5F\u5E0C\u671B\u672C\u9875\u7684\u4EF7\u683C\u80FD\u5BF9\u60A8\u6709\u6240\u5E2E\u52A9\u3002</p><p>\u8C22\u8C22\u60A8\u7684\u6765\u8BBF\uFF0C<code>\u5C0FT\u540C\u5B66</code>\u66F4\u5E0C\u671B\u672C\u7AD9\u7684\u5176\u4ED6\u5185\u5BB9\u80FD\u7ED9\u60A8\u5E26\u6765\u5E2E\u52A9\uFF01</p>',59);function l(p,r){return a}var n=e(i,[["render",l],["__file","index.html.vue"]]);export{n as default};
